import React, { Component } from 'react';
import Images from './Images';

class List extends Component{
    render(){
        return(
            <ol>
                <Images linkGambar="https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/food1.jpg"/>
                <Images linkGambar="https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/nasipadang.jpg"/>
                <li>Nasi Padang</li>
                
                <li>Soto Lamongan</li>
                <Images linkGambar="https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/sate.png&sa=D&ust=1584886701733000"/>
                <li>Sate</li>                
            </ol>
        );
    }
}

export default List;
